content:
query {
  checkquit
  if (!$1) { thmecho -a Syntax: $thmho(/q [-snxmd]) nickname }
  else {
    if ($regsubex($1,/^|\G([snxmd])/Fg,\1)) {
      if ($2) { var %1 $1,%nick $2 }
      else { var %nick $1 }
    }
    if ($chr(45) == $left(%nick,1)) { thmerror -a /query: insufficient parameters }
    elseif ($chr(35) == $left(%nick,1)) || ($chr(35) == $left(%1,1)) && (%nick) { thmerror -a /query: invalid parameters }
    else {
      if (!$query(%nick)) {
        if ($mouse.key & 8) { query -n %nick }
        else { query %1 %nick }
        if ($ve(7,settings)) && ($($+(%,query.,$network,.,%nick),2)) { unset $+(%,query.,$network,.,%nick) }
        if ($address(%nick,5) isignore) { .ignore -rp %nick 5 }
        if (%querywhois) { whois %nick }
        if ($address(%nick,5) != $null) { set $+(%,qcls.ls.,$cid,.,%nick) $ctime }
        stat.queryref
        echo %nick $ehe Query with $shm(mode,%nick) $+ $+($iif($ial(%nick),$chr(47)),$shm(mode,$wd($address(%nick,0),2,33))) opened on $shm(mode,$longtime) $+ .
        if (%querystats) {
          echo %nick $ehe Total queries: $shm(mode,%stat.queries) $+ / $+ $shm(mode,~ $+ $iif($dayavg(%stat.queries,1) < %stat.queries,$v1,%stat.queries) per day)
          echo %nick $ehe Queries today: $shm(mode,%stat.queriestoday)
          if ($comchan(%nick,0)) && (%nick != $me) {
            var %i = $comchan(%nick,0),%r
            while (%i) {
              if ($1 !isreg $comchan(%nick,%i)) { var %p = $left($nick($comchan(%nick,%i),%nick).pnick,1) }
              else { unset %p }
              var %r = %r %p $+ $comchan(%nick,%i)
              dec %i
            }
            echo %nick $ehe Common channels: $replace($shm(mode,%r),$chr(32),$chr(44) $chr(32))
          }
          echo %nick $cr
        }
      }
      elseif ($mouse.key & 8) { query -n %nick }
      else { query %1 %nick }
    }
  }
}
